srcDoc.css:
h2.inkbunny_mascot {
  display: block;
  background-image: url(https://api.keiau.space/image?url=https://inkbunny.net/images81/elephant/logo/bunny57.png);
  width: 190px;
  height: 195px;
  left: 50px;
  top: 2px;
  pointer-events: none;
}

h1.inkbunny_navigation {
  display: block;
  width: 324px;
  height: 98px;
  position: absolute;
  left: 122px;
  top: 44px;
  margin: 0;
  border: 0;
  background-image: url(https://api.keiau.space/image?url=https://inkbunny.net/images81/elephant/logo/text.png);
}

.floating {
  animation-name: floating;
  animation-duration: 5s;
  animation-iteration-count: infinite;
  animation-timing-function: ease-in-out;
  margin-left: 30px;
  margin-top: 5px;
}

@keyframes floating {
  0% {
    transform: translate(0, 0px);
  }
  50% {
    transform: translate(0, 5px);
  }
  100% {
    transform: translate(0, 0px);
  }
}
.white {
  color: white;
}

.subtext {
  transform: translate(14px, 35px) !important;
  color: #c8d0e7;
  font-size: 50%;
}

.tilt {
  rotate: z 351.33deg;
  transform: translate(0, -25px);
  text-shadow: rgba(80, 80, 80, 0.3215686275) 1px 0 10px;
}

.inter {
  font-family: Inter, sans-serif;
}

